from functools import lru_cache


class Solution:
    def numberOfArrays(self, s: str, k: int) -> int:
        if k < 9:
            for i in range(k + 1, 10):
                if str(i) in s:
                    return 0
        MOD = 10 ** 9 + 7
        memo = {}

        def dp(n):  # s[:n+1] 有多少种方法
            if n < 0:
                return 1
            if n in memo:
                return memo[n]
            res = 0
            cut = 0
            i = n
            while i >= 0 and cut <= k:
                if s[i] != "0":
                    cut += int(s[i]) * 10 ** (n - i)
                    if cut <= k:
                        res = (res + dp(i - 1)) % MOD
                i -= 1

            memo[n] = res
            return res

        ans = dp(len(s) - 1)
        # print(memo)
        return ans


